import '../css/MainPage.css'

export default function MainPage(){
    const ingredients=["Tomoatoes","Chicken","Oregano"]
    const additem=ingredients.map((each)=>{
        <li>{each}</li>
    })
    return(
        <>
            <form className="add_items">
                <input type="text" placeholder='e.g..Oregano'/>
                <button ><span>+</span><p>Add ingredient</p></button>
            </form>
            <ul id="list">
                {additem}
            </ul>
        </>
    )
}
